import React,{useState} from 'react';
import Card from './component/Card';
import './App.css';

interface Person {
  name: string
  lastName: string
  age: number
  job: boolean
  description: string
}

function App() {

  const [person, setPerson] = useState <Person>()
  return (
    <div className="App">
      <Card person={person} setPerson={setPerson}/>

    </div>
  );
}

export default App;
